import React, { useState } from 'react';
import { 
  Card, 
  CardContent, 
  Typography, 
  Box, 
  FormControl, 
  InputLabel, 
  Select, 
  MenuItem,
  Grid,
  Button,
  Chip
} from '@mui/material';
import { 
  LineChart, 
  Line, 
  XAxis, 
  YAxis, 
  CartesianGrid, 
  Tooltip, 
  Legend, 
  ResponsiveContainer,
  ComposedChart,
  Bar,
  Area,
  Scatter
} from 'recharts';
import { Add, Settings } from '@mui/icons-material';

interface ChartData {
  date: string;
  sharePrice: number;
  ntPE: number;
  ntEPS: number;
  revenue: number;
  eps: number;
  peRatio: number;
}

const ChartSection: React.FC = () => {
  const [xAxis, setXAxis] = useState<string>('date');
  const [yAxis1, setYAxis1] = useState<string>('sharePrice');
  const [yAxis2, setYAxis2] = useState<string>('ntPE');
  const [yAxis3, setYAxis3] = useState<string>('ntEPS');
  const [chartType, setChartType] = useState<string>('line');

  // Mock data - replace with actual data
  const chartData: ChartData[] = [
    { date: '2023-01', sharePrice: 120, ntPE: 25, ntEPS: 4.8, revenue: 19500, eps: 5.15, peRatio: 23.3 },
    { date: '2023-02', sharePrice: 125, ntPE: 26, ntEPS: 4.9, revenue: 19800, eps: 5.25, peRatio: 23.8 },
    { date: '2023-03', sharePrice: 130, ntPE: 27, ntEPS: 5.0, revenue: 20100, eps: 5.35, peRatio: 24.3 },
    { date: '2023-04', sharePrice: 135, ntPE: 28, ntEPS: 5.1, revenue: 20400, eps: 5.45, peRatio: 24.8 },
    { date: '2023-05', sharePrice: 140, ntPE: 29, ntEPS: 5.2, revenue: 20700, eps: 5.55, peRatio: 25.2 },
    { date: '2023-06', sharePrice: 145, ntPE: 30, ntEPS: 5.3, revenue: 21000, eps: 5.65, peRatio: 25.7 },
    { date: '2023-07', sharePrice: 150, ntPE: 31, ntEPS: 5.4, revenue: 21300, eps: 5.75, peRatio: 26.1 },
    { date: '2023-08', sharePrice: 155, ntPE: 32, ntEPS: 5.5, revenue: 21600, eps: 5.85, peRatio: 26.5 },
    { date: '2023-09', sharePrice: 160, ntPE: 33, ntEPS: 5.6, revenue: 21900, eps: 5.95, peRatio: 26.9 },
    { date: '2023-10', sharePrice: 165, ntPE: 34, ntEPS: 5.7, revenue: 22200, eps: 6.05, peRatio: 27.3 },
    { date: '2023-11', sharePrice: 170, ntPE: 35, ntEPS: 5.8, revenue: 22500, eps: 6.15, peRatio: 27.6 },
    { date: '2023-12', sharePrice: 175, ntPE: 36, ntEPS: 5.9, revenue: 22800, eps: 6.25, peRatio: 28.0 },
  ];

  const axisOptions = [
    { value: 'date', label: 'Date' },
    { value: 'sharePrice', label: 'Share Price' },
    { value: 'ntPE', label: 'NTM P/E' },
    { value: 'ntEPS', label: 'NTM EPS' },
    { value: 'revenue', label: 'Revenue' },
    { value: 'eps', label: 'EPS' },
    { value: 'peRatio', label: 'P/E Ratio' }
  ];

  const chartTypes = [
    { value: 'line', label: 'Line Chart' },
    { value: 'area', label: 'Area Chart' },
    { value: 'bar', label: 'Bar Chart' },
    { value: 'composed', label: 'Composed Chart' }
  ];

  const getAxisLabel = (value: string): string => {
    const option = axisOptions.find(opt => opt.value === value);
    return option ? option.label : value;
  };

  const getChartTypeLabel = (value: string): string => {
    const option = chartTypes.find(opt => opt.value === value);
    return option ? option.label : value;
  };

  const renderChart = () => {
    const commonProps = {
      data: chartData,
      margin: { top: 20, right: 30, left: 20, bottom: 5 }
    };

    switch (chartType) {
      case 'line':
        return (
          <LineChart {...commonProps}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey={xAxis} />
            <YAxis yAxisId="left" />
            <YAxis yAxisId="right" orientation="right" />
            <YAxis yAxisId="third" orientation="right" />
            <Tooltip />
            <Legend />
            <Line yAxisId="left" type="monotone" dataKey={yAxis1} stroke="#8884d8" name={getAxisLabel(yAxis1)} />
            <Line yAxisId="right" type="monotone" dataKey={yAxis2} stroke="#82ca9d" name={getAxisLabel(yAxis2)} />
            <Line yAxisId="third" type="monotone" dataKey={yAxis3} stroke="#ffc658" name={getAxisLabel(yAxis3)} />
          </LineChart>
        );
      case 'area':
        return (
          <LineChart {...commonProps}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey={xAxis} />
            <YAxis yAxisId="left" />
            <YAxis yAxisId="right" orientation="right" />
            <YAxis yAxisId="third" orientation="right" />
            <Tooltip />
            <Legend />
            <Line yAxisId="left" type="monotone" dataKey={yAxis1} stroke="#8884d8" fill="#8884d8" fillOpacity={0.3} name={getAxisLabel(yAxis1)} />
            <Line yAxisId="right" type="monotone" dataKey={yAxis2} stroke="#82ca9d" fill="#82ca9d" fillOpacity={0.3} name={getAxisLabel(yAxis2)} />
            <Line yAxisId="third" type="monotone" dataKey={yAxis3} stroke="#ffc658" fill="#ffc658" fillOpacity={0.3} name={getAxisLabel(yAxis3)} />
          </LineChart>
        );
      case 'bar':
        return (
          <ComposedChart {...commonProps}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey={xAxis} />
            <YAxis yAxisId="left" />
            <YAxis yAxisId="right" orientation="right" />
            <YAxis yAxisId="third" orientation="right" />
            <Tooltip />
            <Legend />
            <Bar yAxisId="left" dataKey={yAxis1} fill="#8884d8" name={getAxisLabel(yAxis1)} />
            <Line yAxisId="right" type="monotone" dataKey={yAxis2} stroke="#82ca9d" name={getAxisLabel(yAxis2)} />
            <Line yAxisId="third" type="monotone" dataKey={yAxis3} stroke="#ffc658" name={getAxisLabel(yAxis3)} />
          </ComposedChart>
        );
      case 'composed':
        return (
          <ComposedChart {...commonProps}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey={xAxis} />
            <YAxis yAxisId="left" />
            <YAxis yAxisId="right" orientation="right" />
            <YAxis yAxisId="third" orientation="right" />
            <Tooltip />
            <Legend />
            <Bar yAxisId="left" dataKey={yAxis1} fill="#8884d8" name={getAxisLabel(yAxis1)} />
            <Area yAxisId="right" type="monotone" dataKey={yAxis2} stroke="#82ca9d" fill="#82ca9d" fillOpacity={0.3} name={getAxisLabel(yAxis2)} />
            <Line yAxisId="third" type="monotone" dataKey={yAxis3} stroke="#ffc658" name={getAxisLabel(yAxis3)} />
          </ComposedChart>
        );
      default:
        return null;
    }
  };

  return (
    <Card sx={{ mb: 3 }}>
      <CardContent>
        <Box sx={{ display: 'flex', alignItems: 'center', mb: 3 }}>
          <Typography variant="h5" component="h2" sx={{ flexGrow: 1 }}>
            Interactive Charts
          </Typography>
          <Chip
            icon={<Settings />}
            label="Customizable"
            color="secondary"
            variant="outlined"
          />
        </Box>

        <Grid container spacing={2} sx={{ mb: 3 }}>
          <Grid item xs={12} md={3}>
            <FormControl fullWidth size="small">
              <InputLabel>Chart Type</InputLabel>
              <Select
                value={chartType}
                label="Chart Type"
                onChange={(e) => setChartType(e.target.value)}
              >
                {chartTypes.map((type) => (
                  <MenuItem key={type.value} value={type.value}>
                    {type.label}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>
          <Grid item xs={12} md={3}>
            <FormControl fullWidth size="small">
              <InputLabel>X-Axis</InputLabel>
              <Select
                value={xAxis}
                label="X-Axis"
                onChange={(e) => setXAxis(e.target.value)}
              >
                {axisOptions.map((option) => (
                  <MenuItem key={option.value} value={option.value}>
                    {option.label}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>
          <Grid item xs={12} md={2}>
            <FormControl fullWidth size="small">
              <InputLabel>Y-Axis 1</InputLabel>
              <Select
                value={yAxis1}
                label="Y-Axis 1"
                onChange={(e) => setYAxis1(e.target.value)}
              >
                {axisOptions.map((option) => (
                  <MenuItem key={option.value} value={option.value}>
                    {option.label}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>
          <Grid item xs={12} md={2}>
            <FormControl fullWidth size="small">
              <InputLabel>Y-Axis 2</InputLabel>
              <Select
                value={yAxis2}
                label="Y-Axis 2"
                onChange={(e) => setYAxis2(e.target.value)}
              >
                {axisOptions.map((option) => (
                  <MenuItem key={option.value} value={option.value}>
                    {option.label}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>
          <Grid item xs={12} md={2}>
            <FormControl fullWidth size="small">
              <InputLabel>Y-Axis 3</InputLabel>
              <Select
                value={yAxis3}
                label="Y-Axis 3"
                onChange={(e) => setYAxis3(e.target.value)}
              >
                {axisOptions.map((option) => (
                  <MenuItem key={option.value} value={option.value}>
                    {option.label}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>
        </Grid>

        <Box sx={{ height: 400, width: '100%' }}>
          <ResponsiveContainer width="100%" height="100%">
            {renderChart()}
          </ResponsiveContainer>
        </Box>

        <Box sx={{ mt: 2, display: 'flex', gap: 1, flexWrap: 'wrap' }}>
          <Chip label={`Default: Share Price vs NTM P/E vs NTM EPS`} color="primary" variant="outlined" />
          <Chip label="Interactive" color="success" size="small" />
          <Chip label="Real-time" color="info" size="small" />
        </Box>
      </CardContent>
    </Card>
  );
};

export default ChartSection;
